INSERT INTO `animeflyer` (`id`, `name`, `number_of_ser`, `number_of_released_series`, `number_of_seasons`, `release_date`, `author`, `img`, `year`, `country`, `date_from`, `date_to`, `girector`, `discovery`, `dubbing`, `trans`, `studio_img`, `rescr`, `comments`, `views`, `date_update`) VALUES
(1, 'Блич / Bleach ', 366, 50, 1, '2012-03-27 12:28:14', 'kOsjaK', 'original.jpg', 2004, 'Япония', '2004-10-05', '2017-03-12', 'Абэ Нориюки', 'Кубо Тайто', 'Anna, Liha, n_o_i_r, Ancord', 'Vallar', 'images\\Studio Pierrot.png', 'Куросаки Ичиго — не простой пятнадцатилетний парень, потому как, сколько он себя помнит, всегда мог запросто общаться с духами и призраками, невидимыми для обычных людей. В один судьбоносный день ему является сама синигами (богиня смерти) Кучики Рукия, охотящаяся за Пустым (злым духом, пожирающим души людей). Во время битвы с этим чудовищем Ичиго и Рукия получили серьёзные ранения, и богине пришлось передать парню свои силы, чтобы помочь ему одержать победу над монстром, в результате чего Ичиго сам стал синигами! Но сделав это, Рукия теряет всю свою мощь, и теперь ожидает, что новоявленный синигами продолжит её миссию по отлову и уничтожению Пустых. Так начинаются увлекательные приключения Ичиго и Рукии.', 140141, 2340141, '2018-01-08 05:44:56'),
(2, 'Бродячие псы: Литературные гении / Bungou Stray Dogs', 12, 1, 1, '2016-12-29 00:00:00', 'Planokyr128', '072328d90b.jpg', 2016, 'Япония', '2016-10-06', '2016-12-16', 'Игараси Такуя', 'Асагири Кафка', 'Студийная банда AD, Cuba77', 'Bobby Deimos, LeDi-MaHo Team', 'images/Bones.jpg', 'Ацуши Накаджиму размашистым пинком выставили из сиротского приюта. Потерявший крышу над головой и обессилевший от голода, юноша, однако, не утратил волю к жизни и даже нашел в себе силы подняться из положения «лежа». В порыве безудержного гнева, вперемешку с горькой обидой, он решил, что единственный способ выжить — грабеж средь бела дня. На счастье, возле реки, где пару минут назад Ацуши готов был отдать концы, пролегала дорога. Осталось только затаиться и ждать.\r\nПлюх.\r\nЧто это? Чьи-то ноги торчат из воды.', 228, 5563, '2018-01-08 05:44:56'),
(3, 'Веселая жизнь в общаге с Йокаями / Youkai Apartment no Yuuga na Nichijou', 26, 4, 1, '2017-07-03 11:00:00', 'Кодзуки Хинова', '0a9724788a.jpg', 2017, 'Япония', '2017-07-03', '2017-12-25', 'Хасимото Мицуо', 'Кодзуки Хинова', 'JAM, Trina_D, Ket, Kiara_Laine', 'NewMeta', 'images/Shinei Animation.jpg', 'Юси Инаба поступает в бизнес-колледж Дзёто и готовится съехать от опостылевших родственников, но в школьном общежитии случается пожар, и ему срочно приходится искать себе новое жилье. Отзывчивый риэлтор Маэда предлагает ему удивительно дешевую комнату в частном общежитии, но предупреждает, что в этом особняке «водятся привидения». Как выяснится впоследствии, одними привидениями дело не ограничится, и новыми соседями Юси станут не только в крайней степени неординарные люди (?), но и самая разная нежить. Хотя и она окажется страшной лишь на первый взгляд.', 117, 3562, '2018-01-08 05:44:56'),
(4, 'Волшебный учитель Нэгима! Хранитель вечности! / UQ Holder! Mahou Sensei Negima!', 12, 1, 2, '2014-12-11 10:26:00', 'Акамацу Кэн', 'e7146e3208.jpg', 2017, 'Япония', '2017-10-03', '2018-03-03', 'Судзуки Ёхэй', 'Акамацу Кэн', ' Ancord, RiZZ_fisher, Jade, Kiara_Laine', 'Zero', 'images/J.C.Staff.jpg', 'За прошедшее десятилетие миру стало известно о существовании магии. Мир перетерпел огромное потрясение. Тем не менее, мальчик по имени Тота, живущий в сельском городке, далек от этих потрясений. Его обычная жизнь выделяется своей магией, он получает поддержку от учительницы и друзей. Однажды, его спокойной повседневной жизни приходит конец, вот тут-то и начинается удивительное приключение.\r\n\r\nСобытия происходит через много лет после окончания Mahou Sensei Negima!, где Неги Спрингфилд является почившим дедушкой главного героя, а его учительница - Евангелина МакДауэлл.', 96, 2256, '2018-01-08 05:44:56'),
(5, 'Гинтама / Gintama', 12, 10, 5, '2017-03-30 23:57:08', ' Planokyr128', '67603a4c9c.jpg', 2017, 'Япония', '2017-01-09', '2017-03-27', 'Мияваки Тидзуру', 'Сорати Хидэаки', 'JAM', 'Miss Sherlockian', 'images\\BandaiNamcologo.png', 'Продолжение старой доброй чернухи.', 1009, 100569, '2018-01-08 05:44:56'),
(6, 'Добро пожаловать в класс элиты / Youkoso Jitsuryoku Shijou Shugi no Kyoushitsu', 12, 3, 1, '2017-10-04 06:18:00', 'Planokyr128', 'superiority class.jpg', 2017, 'Япония', '2017-07-12', '2017-09-27', 'Киси сэйдзи', 'Кинугаса Сёго', 'Ancord', 'FooBoo', 'images\\Lerche.png', 'Старшая школа Кёдо Икусей - престижное учебное заведение с великолепными показателями, 100% учащихся поступают в университеты или находят работу. Учащимся позволено ходить с любыми прическами и приносить любые личные вещи. Кёдо Икусей - школа, похожая на рай, но правда состоит в том, что такой подход применим только к самым выдающимся ученикам. Главный герой, Киётака Аянокодзи, учится в классе D, куда управление школы \"сливает\" студентов с низкой успеваемостью. Киётака был невнимателен на вступительном экзамене, поэтому и попал туда. После встречи с Судзуне Хорикитой и Кикуо Кусидой, двумя его одноклассницами, его положение начинает меняться....', 793, 25597, '2018-01-08 05:44:56'),
(7, 'Моя геройская академия / Boku no Hero Academia', 25, 12, 2, '2017-10-02 00:15:03', 'Planokyr128', '6e22e1f22d.jpg', 2017, 'Япония', '2017-04-01', '2017-09-30', 'Нагасаки Кэндзи', 'Хорикоси Кохэй', 'JAM', 'Вертолет', 'images/Bones.jpg', 'Четырнадцатилетний Изуку Мидория рано осознал, что люди не рождаются равными. А пришло это понимание, когда его начали дразнить одноклассники, одаренные особой силой. Несмотря на то, что большинство людей в этом мире рождаются с необычными способностями, Изуку оказался среди тех немногих, кто напрочь их лишен. Однако это не стало помехой для мальчика в стремлении стать таким же легендарным героем, как Всемогущий. Для осуществления мечты Изуку не без помощи своего кумира поступает в самую престижную академию героев Юэй, но на этом, как известно, приключения только начинаются.', 1262, 15021, '2018-01-08 05:44:56'),
(8, 'Невеста чародея / Mahou Tsukai no Yome', 24, 2, 1, '2017-10-12 07:22:18', ' Planokyr128', 'The_Ancient_Magus.jpg', 2017, 'Япония', '2017-10-08', '0000-00-00', 'Наганума Норихиро', 'Ямадзаки Корэ', 'JAM, Trina_D', 'YakuSub Studio', 'images\\Wit_studio.png', 'Хатори Чисэ только 16, но она уже пережила все тяготы жизни. У неё нет никого, и жизнь её не имеет смысла. Но внезапно уже успевшие заржаветь шестерёнки судьбы начинают двигаться. В тяжёлый момент таинственный маг предложил Чисэ помощь, от которой она не могла отказаться. Но кто же он? Он похож скорее на демона, чем на человека. Поможет ли он ей или же ввергнет в пучину тьмы?', 50, 1024, '2018-01-08 05:44:56'),
(9, 'Погружение / Dive!!', 12, 2, 1, '2017-12-18 00:10:00', 'bucherino', '753bc2569d.jpg', 2017, 'Япония', '2017-07-07', '2017-09-22', 'Судзуки Каору', 'Мори Это', 'Ancord, Jade', 'Коронзона', 'images/Zero-G.jpg', 'Клуб прыжков в воду Мидзуки находится на грани закрытия из-за проблем с финансированием. Однако новый тренер уговаривает инвесторов дать спортсменам последний шанс, но с одним условием: кто-то из участников должен обязательно пробиться в олимпийскую сборную и поехать на Олимпиаду в следующем году.', 11, 563, '2018-01-08 05:44:56'),
(10, 'Страж Возрождения / Code:Realize - Sousei no Himegimi', 8, 12, 1, '2017-12-14 06:18:18', 'Харада Саяка', '53683a8242.jpg', 2017, 'Япония', '2017-12-03', '2018-04-21', 'Ямамото Хидэё', 'Харада Саяка', 'Jade, Bars MacAdams, HYVER, Berserk', 'Coronzona', 'images\\Seven.jpg', 'В крови Кардии течет смертельный яд. Все, до чего она касается, плавится на глазах. Из-за этой способности её стали звать монстром. И однажды ночью она встречает таинственного человека по имени Арсен Люпен, который соглашается проводить ее до Индустриального Лондона. В своём путешествии Кардия узнает истории и секреты различных людей, пытаясь вернуть себе память и найти отца, который знает правду о её воспоминаниях.', 56, 965, '2018-01-08 05:44:56'),
(11, 'Чёрный клевер / Black Clover', 12, 11, 1, '2016-10-03 08:16:37', 'bucherino', 'd0733d93a5.jpg', 2016, 'Япония', '2016-11-20', '0000-00-00', 'Ното Такаиши', 'Табата Юки', 'Nika Lenina, JAM', 'Angrod', 'images\\adwadawd.png', 'У главного героя, Асты, сироты, с детства есть мечта. Он стремится стать великим архимагом. С юности он тренировался, чтобы стать первым из всех магов и получить гримуар архимага! Но в итоге.... ему достается вовсе не тот гримуар, который он ожидал получить. Путь героя к становлению легендой начинается.', 30, 891, '2018-01-08 05:44:56'),
(12, 'Ярость Бахамута: Невинная душа / Shingeki no Bahamut: Virgin Soul', 24, 10, 1, '2017-10-11 10:27:40', 'bucherino', 'xjgj.jpg', 2017, 'Япония', '2017-04-08', '2017-09-30', 'Сато Кэйити', 'Ойси Сидзука', 'Студийная Банда', 'FooBoo', 'images\\MAPPA.jpg', 'События новой части сериала происходят спустя десять лет после произошедшего в Shingeki no Bahamut: Genesis и рассказывают уже о новых героях. Люди в королевской столице наслаждаются благоденствием, демоны покорены и в качестве рабов помогают восстанавливать столицу, а боги теряют силу из-за потери людьми религиозности. Баланс мира нарушен, потому что у людей, демонов и богов различные представления о справедливости....', 575, 11576, '2018-01-08 05:44:56'),
(13, 'Блич / Bleach ', 366, 50, 1, '2012-03-27 12:28:14', 'kOsjaK', 'original.jpg', 2004, 'Япония', '2004-10-05', '2017-03-12', 'Абэ Нориюки', 'Кубо Тайто', 'Anna, Liha, n_o_i_r, Ancord', 'Vallar', 'images\\Studio Pierrot.png', 'Куросаки Ичиго — не простой пятнадцатилетний парень, потому как, сколько он себя помнит, всегда мог запросто общаться с духами и призраками, невидимыми для обычных людей. В один судьбоносный день ему является сама синигами (богиня смерти) Кучики Рукия, охотящаяся за Пустым (злым духом, пожирающим души людей). Во время битвы с этим чудовищем Ичиго и Рукия получили серьёзные ранения, и богине пришлось передать парню свои силы, чтобы помочь ему одержать победу над монстром, в результате чего Ичиго сам стал синигами! Но сделав это, Рукия теряет всю свою мощь, и теперь ожидает, что новоявленный синигами продолжит её миссию по отлову и уничтожению Пустых. Так начинаются увлекательные приключения Ичиго и Рукии.', 140141, 2340141, '2018-01-08 05:44:56'),
(14, 'Бродячие псы: Литературные гении / Bungou Stray Dogs', 12, 1, 1, '2016-12-29 00:00:00', 'Planokyr128', '072328d90b.jpg', 2016, 'Япония', '2016-10-06', '2016-12-16', 'Игараси Такуя', 'Асагири Кафка', 'Студийная банда AD, Cuba77', 'Bobby Deimos, LeDi-MaHo Team', 'images/Bones.jpg', 'Ацуши Накаджиму размашистым пинком выставили из сиротского приюта. Потерявший крышу над головой и обессилевший от голода, юноша, однако, не утратил волю к жизни и даже нашел в себе силы подняться из положения «лежа». В порыве безудержного гнева, вперемешку с горькой обидой, он решил, что единственный способ выжить — грабеж средь бела дня. На счастье, возле реки, где пару минут назад Ацуши готов был отдать концы, пролегала дорога. Осталось только затаиться и ждать.\r\nПлюх.\r\nЧто это? Чьи-то ноги торчат из воды.', 228, 5563, '2018-01-08 05:44:56'),
