(270, 'Ярость Бахамута: Невинная душа / Shingeki no Bahamut: Virgin Soul', 24, 10, 1, '2017-10-11 10:27:40', 'bucherino', 'xjgj.jpg', 2017, 'Япония', '2017-04-08', '2017-09-30', 'Сато Кэйити', 'Ойси Сидзука', 'Студийная Банда', 'FooBoo', 'images\\MAPPA.jpg', 'События новой части сериала происходят спустя десять лет после произошедшего в Shingeki no Bahamut: Genesis и рассказывают уже о новых героях. Люди в королевской столице наслаждаются благоденствием, демоны покорены и в качестве рабов помогают восстанавливать столицу, а боги теряют силу из-за потери людьми религиозности. Баланс мира нарушен, потому что у людей, демонов и богов различные представления о справедливости....', 575, 11576, '2010-01-27 10:48:00'),
